  'source' => 'You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1438',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Reusing fields',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1439',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1440',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1441',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1442',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Fields on content items',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1443',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href="@types">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1444',
  'location' => '/is/admin/modules',
