  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Fields on user accounts are defined on a site-wide basis on the <a href="@fields">Manage fields tab</a> of the <a href="@accounts">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.',
  'context' => '',
  'version' => '7.56',
