->values(array(
  'lid' => '1453',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'The File module allows users to attach files to content (e.g., PDF files, spreadsheets, etc.), when a <em>File</em> field is added to a given content type using the <a href="@fieldui-help">Field UI module</a>. You can add validation options to your File field, such as specifying a maximum file size and allowed file extensions.',
  'context' => '',
  'version' => '7.56',
