  'source' => 'Managing file locations',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1457',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => "When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file's URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.",
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1458',
