  'version' => '7.56',
))
->values(array(
  'lid' => '1459',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href="@filter">Filter module</a>.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1460',
