  'version' => '7.56',
))
->values(array(
  'lid' => '1461',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Configure text formats on the <a href="@formats">Text formats page</a>. <strong>Improper text format configuration is a security risk</strong>. To ensure security, untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags, since certain HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich content.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1462',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Applying filters to text',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1463',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1464',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Defining text formats',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1465',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href="@text-formats">Text formats page</a>.',
  'context' => '',
  'version' => '7.56',
