  'lid' => '1676',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Visit the <a href="@admin-simpletest">Testing page</a> to display a list of available tests. For comprehensive testing, select <em>all</em> tests, or individually select tests for more targeted testing. Note that it might take several minutes for all tests to complete. For more information on creating and modifying your own tests, see the <a href="@simpletest-api">Testing API Documentation</a> in the Drupal handbook.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1677',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'After the tests run, a message will be displayed next to each test group indicating whether tests within it passed, failed, or had exceptions. A pass means that the test returned the expected results, while fail means that it did not. An exception normally indicates an error outside of the test, such as a PHP warning or notice. If there were failures or exceptions, the results will be expanded to show details, and the tests that had failures or exceptions will be indicated in red or pink rows. You can then use these results to refine your code and tests, until all tests pass.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1678',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => 'Provides a framework for unit and functional testing.',
  'context' => '',
  'version' => '7.56',
))
->values(array(
  'lid' => '1679',
  'location' => '/is/admin/modules',
  'textgroup' => 'default',
  'source' => "The Text module defines various text field types for the Field module. A text field may contain plain text only, or optionally, may use Drupal's <a href='@filter-help'>text filters</a> to securely manage HTML output. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, the field can be validated, so that it is limited to a set of allowed values. See the <a href='@field-help'>Field module help page</a> for more information about fields.",
